(1, 'admin@quickray.tech', '085624836317', 'info.quickray.tech', '', '<div xss=\"removed\"><h4 xss=\"removed\">KEBIJAKAN PRIVASI</h4><h4 xss=\"removed\">Mulai dari 14 Mei 2020</h4><p xss=\"removed\">Kebijakan Privasi berikut ini menjelaskan bagaimana kami, QUICK(QUICKRAY DEVELOVER dan afiliasi-afiliasi, atau “<strong>kami</strong>”) mengumpulkan, menyimpan, menggunakan, mengolah, menguasai, mentransfer, mengungkapkan dan melindungi Informasi Pribadi anda. Kebijakan Privasi ini berlaku bagi seluruh pengguna aplikasi-aplikasi,  layanan, atau produk (“<strong>Aplikasi</strong>”) kami, kecuali diatur pada kebijakan privasi yang terpisah.</p><p xss=\"removed\">Mohon baca Kebijakan Privasi ini dengan seksama untuk memastikan bahwa anda memahami bagaimana proses pengolahan data kami. Kecuali didefinisikan lain, semua istilah dengan huruf kapital yang digunakan dalam Kebijakan Privasi ini memiliki arti yang sama dengan yang tercantum dalam Ketentuan Penggunaan.</p><p xss=\"removed\">Kebijakan Privasi ini mencakup hal-hal sebagai berikut:</p><ol xss=\"removed\"><li xss=\"removed\">Informasi Pribadi yang kami kumpulkan</li><li xss=\"removed\">Penggunaan Informasi Pribadi yang kami kumpulkan</li><li xss=\"removed\">Pemberian Informasi Pribadi yang kami kumpulkan</li><li xss=\"removed\">Penyimpanan Informasi Pribadi</li><li xss=\"removed\">Akses dan koreksi Informasi Pribadi</li><li xss=\"removed\">Tempat kami menyimpan Informasi Pribadi anda</li><li xss=\"removed\">Keamanan Informasi Pribadi anda</li><li xss=\"removed\">Perubahan atas Kebijakan Privasi ini</li><li xss=\"removed\">Pengakuan dan persetujuan</li><li xss=\"removed\">Materi pemasaran dan promosi</li><li xss=\"removed\">Data anonim</li><li xss=\"removed\">Platform pihak ketiga</li><li xss=\"removed\">Cara untuk menghubungi kami</li></ol><p xss=\"removed\"> </p><ol xss=\"removed\"><li xss=\"removed\"><strong>INFORMASI PRIBADI YANG KAMI KUMPULKAN</strong><p xss=\"removed\"><strong><br></strong>Kami mengumpulkan informasi yang mengidentifikasikan atau dapat digunakan untuk mengidentifikasi, menghubungi, atau menemukan orang atau perangkat yang terkait dengan informasi tersebut (\"<strong>Informasi Pribadi</strong>\"). Informasi Pribadi termasuk, tetapi tidak terbatas pada, nama, alamat, tanggal lahir, pekerjaan, nomor telepon, alamat e-mail, rekening bank dan detail kartu kredit, jenis kelamin, identifikasi (termasuk KTP, SIM, atau Paspor) atau tanda pengenal lainnya yang dikeluarkan oleh pemerintah, foto, kewarganegaraan, nomor telepon pengguna dan non-pengguna Aplikasi kami yang terdapat dalam daftar kontak telefon selular anda, data kesehatan, informasi keuangan terkait, serta informasi biometrik (termasuk namun tidak terbatas pengenalan wajah). Selain itu, untuk informasi lainnya, seperti profil pribadi, dan/atau nomor pengenal unik, yang dikaitkan atau digabungkan dengan Informasi Pribadi, maka informasi tersebut juga dianggap sebagai Informasi Pribadi. Informasi Pribadi yang kami kumpulkan dapat diberikan oleh anda secara langsung atau oleh pihak ketiga (misalnya: ketika anda mendaftar atau menggunakan Aplikasi, ketika anda menghubungi layanan pelanggan kami, atau sebaliknya ketika anda memberikan Informasi Pribadi kepada kami). Kami dapat mengumpulkan informasi dalam berbagai macam bentuk dan tujuan (termasuk tujuan yang diizinkan berdasarkan peraturan perundang-undangan yang berlaku).<br><br><strong>Informasi yang kami kumpulkan dari anda atau perangkat seluler anda secara langsung</strong></p><ul class=\"list-disc\" xss=\"removed\"><li xss=\"removed\">Ketika anda mendaftar dan membuat akun dengan kami menggunakan Aplikasi, anda harus memberikan kepada kami Informasi Pribadi tertentu, termasuk nama, alamat fisik, alamat e-mail, dan nomor telepon anda. Jika anda menggunakan Aplikasi sebagai penyedia layanan, anda harus memberikan Informasi Pribadi tambahan kepada kami sebagai bagian dari proses pendaftaran penyedia layanan. Ini akan mencakup rincian mengenai kendaraan anda (izin, persetujuan, dan otorisasi lainnya yang anda perlukan untuk mengoperasikan kendaraan dan untuk menyediakan layanan transportasi), polis asuransi anda, dan rekening bank anda untuk keperluan menerima pembayaran.</li><li xss=\"removed\">Ketika anda menggunakan Aplikasi, anda harus memberikan kami informasi yang relevan yang mungkin diperlukan oleh kami agar Aplikasi dapat berfungsi, contohnya:<ul class=\"list-circle\" xss=\"removed\"><li xss=\"removed\">Jika anda menggunakan Aplikasi sebagai pengguna, anda harus memberikan informasi pada kami sesuai dengan jenis layanan yang anda cari, dan rincian penjemputan dan/atau pengiriman.</li><li xss=\"removed\">Jika anda menggunakan Aplikasi sebagai penyedia layanan, agar Aplikasi dapat berfungsi, anda harus memberikan kepada kami informasi terkait dengan layanan yang anda dapat terima pesanannya pada saat itu, dan perinciannya pada saat ini, dan setelah pesanan untuk layanan yang ditempatkan oleh pengguna diterima oleh anda sebagai penyedia layanan, anda mungkin akan perlu memberikan kepada kami data lain yang kami perlukan untuk mengelola Aplikasi dan ekosistem terkait, serta untuk memantau keseluruhan penggunaan Aplikasi.</li><li xss=\"removed\">Jika anda menggunakan dan/atau ketika pembayaran atau transfer dilakukan melalui fasilitas uang elektronik dan/atau dompet elektronik yang disediakan oleh kami, jika anda adalah pihak pembayar, anda akan menyediakan informasi kepada kami yang berkaitan dengan penggunaan, pembayaran atau transfer, termasuk tetapi tidak terbatas pada rincian transfer dan/atau penerima pembayaran, jumlah pembayaran yang dibayarkan, jenis kartu pembayaran yang digunakan, nama penerbit kartu pembayaran tersebut, nama pemegang rekening dan nomor kartu pembayaran tersebut.</li><li xss=\"removed\">Jika anda bermaksud untuk mendaftar sebagai pemegang akun terdaftar atau terverifikasi dari fasilitas uang elektronik yang disediakan oleh kami, anda akan memberikan informasi kepada kami yang diperlukan termasuk tetapi tidak terbatas pada nama lengkap anda, nomor kartu identitas anda, jenis kartu identitas yang anda gunakan untuk registrasi, alamat, jenis kelamin, tempat dan tanggal lahir, pekerjaan, kebangsaan dan/atau data biometrik.</li></ul></li></ul><p xss=\"removed\"><strong>Informasi yang dikumpulkan setiap kali anda menggunakan Aplikasi atau mengunjungi situs web kami</strong></p><ul class=\"list-disc\" xss=\"removed\"><li xss=\"removed\">Setiap kali anda menggunakan Aplikasi atau mengunjungi situs web kami, kami dapat mengumpulkan data teknis tertentu sehubungan dengan penggunaan anda seperti, alamat protokol internet, informasi halaman web yang sebelumnya atau selanjutnya dilihat, durasi setiap kunjungan/sesi, identitas perangkat internet atau alamat kontrol akses media, dan <em>mobile advertising ID</em> dan informasi perangkat lainnya termasuk informasi mengenai produsen, model, dan sistem operasi dari perangkat yang anda gunakan untuk mengakses Aplikasi atau situs web kami.</li><li xss=\"removed\">Ketika anda menggunakan Aplikasi atau mengunjungi situs web kami, informasi tertentu juga dapat dikumpulkan secara otomatis dengan menggunakan <em>cookies</em>. <em>Cookies</em> adalah berkas data kecil yang tersimpan pada komputer atau perangkat seluler anda. Kami menggunakan <em>cookies</em> untuk melacak aktivitas pengguna dengan tujuan untuk meningkatkan antarmuka dan pengalaman pengguna. Sebagian besar perangkat seluler dan peramban internet mendukung penggunaan <em>cookies</em>; namun anda dapat menyesuaikan pengaturan pada perangkat seluler atau peramban internet anda untuk menolak beberapa jenis <em>cookies</em> atau <em>cookies</em> spesifik tertentu. Perangkat seluler dan/atau peramban anda juga memungkinkan anda untuk menghapus cookies apa pun yang sebelumnya telah tersimpan. Namun demikian, hal itu dapat mempengaruhi fungsi-fungsi yang tersedia pada Aplikasi atau situs web kami.</li><li xss=\"removed\">Setiap kali anda menggunakan Aplikasi melalui perangkat seluler, kami akan melacak dan mengumpulkan informasi lokasi geografis anda dalam waktu sebenarnya. Dalam beberapa kasus, anda akan diminta atau diharuskan untuk mengaktifkan <em>Global Positioning System</em> (GPS) pada perangkat seluler anda untuk memungkinkan kami agar dapat memberikan anda pengalaman yang lebih baik dalam menggunakan Aplikasi (misalnya, untuk memberikan informasi tentang seberapa dekat penyedia layanan dengan anda). Anda dapat menonaktifkan informasi pelacakan lokasi geografis pada perangkat seluler anda untuk sementara waktu. Namun, hal ini dapat mempengaruhi fungsi-fungsi yang tersedia pada Aplikasi.</li><li xss=\"removed\">Jika anda menggunakan dan/atau ketika pembayaran atau transfer dilakukan melalui fasilitas uang elektronik dan/atau dompet elektronik yang disediakan oleh kami, kami dapat mengumpulkan informasi tertentu terkait dengan sumber dana yang anda gunakan untuk melakukan isi ulang (termasuk rincian rekening bank), rincian rekening penerima penarikan, riwayat transaksi (termasuk detail penerima), rincian tagihan, faktur, dan nomor telepon.</li><li xss=\"removed\">Jika anda menggunakan akun virtual yang disediakan oleh kami untuk menerima pembayaran menggunakan uang elektronik dan/atau dompet elektronik dari pembayar, baik anda penyedia layanan atau merchant, kami dapat mengumpulkan informasi tertentu yang terkait dengan penggunaan anda termasuk tetapi tidak terbatas pada layanan dan/atau barang yang ditransaksikan, jumlah yang anda kumpulkan dari setiap transaksi, rincian akun penarikan atau penyelesaian pembayaran dan riwayat penarikan atau penyelesaian pembayaran.</li></ul><p xss=\"removed\"><strong>Informasi yang dikumpulkan dari pihak ketiga</strong></p><p xss=\"removed\">Kami juga dapat mengumpulkan Informasi Pribadi anda dari pihak ketiga (termasuk agen, vendor, pemasok, kontraktor, mitra, dan pihak lainnya yang memberikan layanan kepada kami, mengumpulkan Data Pribadi dan/atau melakukan tugas atas nama kami, atau dengan siapa kami melakukan kerja sama). Dalam kasus tersebut, kami hanya akan mengumpulkan Informasi Pribadi anda untuk atau sehubungan dengan tujuan yang melibatkan pihak ketiga tersebut atau tujuan kerja sama kami dengan pihak ketiga tersebut (tergantung pada situasinya).</p><p xss=\"removed\"><strong>Informasi tentang pihak ketiga yang anda berikan kepada kami</strong></p><ul class=\"list-disc\" xss=\"removed\"><li xss=\"removed\">Anda dapat memberikan kepada kami Informasi Pribadi yang berkaitan dengan individu pihak ketiga lainnya (termasuk Informasi Pribadi yang berkaitan dengan pasangan anda, anggota keluarga, teman, atau individu lain). Anda tentu saja akan memerlukan persetujuan dari mereka terlebih dahulu untuk melakukannya - lihat “Pengakuan dan Persetujuan”, di bawah, untuk informasi lebih lanjut.</li><li xss=\"removed\">Kami tidak mewajibkan atau mendukung, ataupun melarang, pemasangan atau penggunaan alat perekam dalam kendaraan di kendaraan apa pun. Jika perangkat tersebut dipasang dan digunakan di kendaraan, kami tidak mengumpulkan Informasi Pribadi apapun dari rekaman dalam kendaraan oleh perangkat tersebut, dan pengumpulan Informasi Pribadi dari rekaman di dalam kendaraan tersebut tidak dilakukan atas nama kami. Pengumpulan Informasi Pribadi dari rekaman di dalam kendaraan tersebut merupakan diskresi dari penyedia layanan. Kami tidak memiliki kendali atas pengumpulan Informasi Pribadi tersebut oleh penyedia layanan dan setiap penggunaan atau pengungkapan oleh penyedia layanan dari Informasi Pribadi yang dikumpulkan. Jika anda adalah penyedia layanan dan memilih untuk mengunduh dan menggunakan perangkat rekaman di dalam kendaraan tersebut di kendaraan anda, anda bertanggung jawab sepenuhnya untuk memberitahukan pengguna. Jika anda adalah seorang pengguna dan anda keberatan atas penggunaan alat perekam dalam kendaraan penyedia layanan, anda harus menyampaikan hal tersebut kepada penyedia layanan secara langsung dan hal tersebut menjadi tanggung jawab pribadi anda.</li><li xss=\"removed\">Jika anda berkeinginan untuk menggunakan fitur pesan di Aplikasi kami, anda akan memberikan nomor telefon pengguna kami yang tersimpan di kontak telefon selular anda secara rutin untuk membantu anda dalam menggunakan fitur pesan kami serta tujuan internal lainnya.</li></ul></li><p xss=\"removed\"> </p><li xss=\"removed\"><strong>PENGGUNAAN INFORMASI PRIBADI YANG KAMI KUMPULKAN</strong><p xss=\"removed\">Kami dapat menggunakan Informasi Pribadi yang dikumpulkan untuk tujuan sebagai berikut maupun untuk tujuan lain yang diizinkan oleh peraturan perundang-undangan yang berlaku (\"<strong>Tujuan\"</strong>):</p><ol xss=\"removed\"><li xss=\"removed\">Jika anda adalah pengguna, kami dapat menggunakan Informasi Pribadi anda:<ul class=\"list-disc\" xss=\"removed\"><li xss=\"removed\">untuk mengidentifikasi dan mendaftarkan anda sebagai pengguna dan untuk mengadministrasikan, memverifikasi, menonaktifkan, atau mengelola akun anda;</li><li xss=\"removed\">untuk memfasilitasi atau memungkinkan verifikasi apapun yang menurut pertimbangan kami diperlukan sebelum penyedia layanan memberikan layanan kepada anda atau sebelum kami mendaftarkan anda sebagai pengguna, termasuk proses Mengenal Pelanggan (Know Your Customer);</li><li xss=\"removed\">untuk memungkinkan penyedia layanan untuk menyediakan layanan yang anda minta;</li><li xss=\"removed\">untuk mengolah dan memfasilitasi pesanan dan transaksi pembayaran yang anda lakukan;</li><li xss=\"removed\">untuk berkomunikasi dengan anda dan mengirimkan anda informasi sehubungan dengan penggunaan Aplikasi;</li><li xss=\"removed\">untuk memberitahu anda mengenai segala pembaruan pada Aplikasi atau perubahan pada layanan yang disediakan;</li><li xss=\"removed\">untuk mengolah dan menanggapi pertanyaan dan saran yang diterima dari anda;</li><li xss=\"removed\">untuk memelihara, mengembangkan, menguji, meningkatkan, dan mempersonalisasikan Aplikasi untuk memenuhi kebutuhan dan preferensi anda sebagai pengguna;</li><li xss=\"removed\">untuk memantau dan menganalisis aktivitas, perilaku, dan data demografis pengguna termasuk kebiasaan dan penggunaan berbagai layanan yang tersedia di Aplikasi;</li><li xss=\"removed\">untuk memproses dan mengelola reward points anda;</li><li xss=\"removed\">untuk menawarkan atau menyediakan layanan dari afiliasi atau mitra kami; dan</li><li xss=\"removed\">untuk mengirimkan anda komunikasi pemasaran, iklan, voucher, survei, dan informasi secara langsung atau terfokus, dan informasi tentang penawaran atau promosi khusus.</li></ul></li><br><li xss=\"removed\">Jika anda adalah penyedia layanan, kami dapat menggunakan Informasi Pribadi anda:<ul class=\"list-disc\" xss=\"removed\"><li xss=\"removed\">untuk mengidentifikasi anda dan mendaftarkan anda sebagai penyedia layanan dan untuk mengadministrasi, mengelola atau memverifikasi Akun anda;</li><li xss=\"removed\">untuk memfasilitasi atau memungkinkan verifikasi apapun yang menurut pertimbangan kami mungkin perlu dilakukan sebelum kami dapat mendaftarkan anda sebagai penyedia layanan, termasuk proses KYC;</li><li xss=\"removed\">untuk memungkinkan anda memberikan layanan kepada pengguna;</li><li xss=\"removed\">untuk mengolah, memfasilitasi, dan menyelesaikan pembayaran kepada anda terkait dengan layanan yang telah anda berikan;</li><li xss=\"removed\">untuk berkomunikasi dengan anda dan mengirimkan anda informasi terkait dengan penyediaan layanan anda, termasuk untuk menyampaikan pesanan pengguna kepada anda dan untuk memfasilitasi penerimaan anda atas pesanan tersebut;</li><li xss=\"removed\">untuk memberikan anda pemberitahuan dan pembaruan pada Aplikasi atau perubahan cara penyediaan layanan;</li><li xss=\"removed\">untuk memberi anda laporan terkait dengan layanan yang telah anda sediakan;</li><li xss=\"removed\">untuk memproses dan menanggapi saran dari pengguna terhadap layanan yang telah anda berikan;</li><li xss=\"removed\">untuk memelihara, mengembangkan, menguji, meningkatkan, dan mempersonalisasikan Aplikasi untuk memenuhi kebutuhan dan preferensi anda sebagai penyedia layanan;</li><li xss=\"removed\">untuk memantau dan menganalisis aktivitas, perilaku, dan data demografis pengguna termasuk kebiasaan dan daya tanggap penyedia layanan untuk berbagai layanan yang tersedia pada Aplikasi;</li><li xss=\"removed\">untuk memproses dan mengelola reward points anda;</li><li xss=\"removed\">untuk menawarkan atau menyediakan layanan dari afiliasi atau mitra kami;</li><li xss=\"removed\">untuk mengirimkan anda komunikasi pemasaran, iklan, promo, survei, dan penawaran khusus atau promosi secara langsung atau tertuju.</li></ul></li><br><li xss=\"removed\">Baik anda merupakan pengguna ataupun penyedia layanan atau pihak yang memberikan Informasi Pribadi kepada kami, kami juga dapat menggunakan Informasi Pribadi anda secara lebih umum untuk tujuan-tujuan sebagai berikut (walaupun dalam kasus tertentu kami akan bertindak secara wajar dan tidak menggunakan Informasi Pribadi anda lebih dari apa yang diperlukan untuk tujuan tersebut):<ul class=\"list-disc\" xss=\"removed\"><li xss=\"removed\">untuk melakukan proses dan fungsi bisnis terkait;</li><li xss=\"removed\">untuk memantau penggunaan Aplikasi dan mengelola, mendukung serta meningkatkan efisiensi kinerja, perkembangan, pengalaman pengguna dan fungsi-fungsi Aplikasi;</li><li xss=\"removed\">untuk memberikan bantuan sehubungan dengan dan untuk menyelesaikan kesulitan teknis atau masalah operasional dengan Aplikasi atau layanan;</li><li xss=\"removed\">untuk menghasilkan informasi statistik dan data analitik untuk tujuan pengujian, penelitian, analisis, pengembangan produk, kemitraan komersial, dan kerja sama;</li><li xss=\"removed\">untuk mencegah, mendeteksi dan menyelidiki segala kegiatan yang dilarang, ilegal, tidak sah, atau curang;</li><li xss=\"removed\">untuk memfasilitasi transaksi aset bisnis (yang dapat berupa penggabungan, akuisisi, atau penjualan aset) yang melibatkan kami dan/atau afiliasi kami; dan</li><li xss=\"removed\">untuk memungkinkan kami mematuhi semua kewajiban berdasarkan peraturan perundang-undangan yang berlaku, (namun tidak terbatas pada menanggapi permintaan, penyelidikan, atau arahan peraturan) dan melakukan pemeriksaan audit, uji tuntas dan penyelidikan.</li></ul></li><br></ol></li><p xss=\"removed\"> </p><li xss=\"removed\"><strong>PEMBERIAN INFORMASI PRIBADI YANG KAMI KUMPULKAN</strong><ol type=\"a\" xss=\"removed\"><li xss=\"removed\">Kami dapat mengungkapkan atau membagikan Informasi Pribadi anda dengan afiliasi dan pihak lain untuk tujuan sebagai berikut ini serta untuk tujuan lain yang diizinkan oleh peraturan perundang-undangan yang berlaku:<ul class=\"list-disc\" xss=\"removed\"><li xss=\"removed\">jika anda adalah pengguna, untuk memungkinkan penyedia layanan, untuk melakukan atau memberikan layanan;</li><li xss=\"removed\">jika anda adalah penyedia layanan, untuk memungkinkan pengguna untuk meminta atau menerima layanan dari anda;</li><li xss=\"removed\">jika disyaratkan atau diotorisasikan oleh peraturan perundang-undangan yang berlaku (termasuk namun tidak terbatas pada menanggapi pertanyaan terkait regulasi, penyelidikan atau pedoman, atau mematuhi persyaratan atau ketentuan pengarsipan dan pelaporan berdasarkan undang-undang), untuk tujuan yang ditentukan dalam peraturan perundang-undangan yang berlaku;</li><li xss=\"removed\">jika diinstruksikan, diminta, disyaratkan atau diperbolehkan oleh pemerintah yang berwenang, untuk tujuan sebagaimana disebutkan dalam kebijakan pemerintah, peraturan atau peraturan perundang-undangan yang berlaku. </li><li xss=\"removed\">jika terdapat proses hukum dalam bentuk apapun antara anda dengan kami, atau antara anda dengan pihak lain, sehubungan dengan, atau terkait dengan layanan, untuk keperluan proses hukum tersebut;</li><li xss=\"removed\">sehubungan dengan segala proses verifikasi yang menurut kami atau penyedia layanan perlu sebelum kami mendaftarkan anda sebagai pengguna, termasuk proses Mengenal Pelanggan (<em>Know Your Customer</em>);</li><li xss=\"removed\">dalam keadaan darurat terkait keselamatan anda (baik anda adalah pengguna atau penyedia layanan) untuk keperluan menangani keadaan darurat tersebut;</li><li xss=\"removed\">dalam situasi terkait kesehatan anda atau kepentingan umum (baik anda adalah pengguna atau penyedia layanan), kami dapat membagikan Informasi Pribadi anda kepada pemerintah yang berwenang dan/atau institusi lainnya yang dapat ditunjuk oleh pemerintah yang berwenang atau memiliki kerja sama dengan kami, untuk tujuan pelacakan kontak, mendukung inisiatif, kebijakan atau program pemerintah, kesehatan public dan tujuan lainnya sebagaimana dibutuhkan secara wajar;</li><li xss=\"removed\">sehubungan dengan, penggabungan, penjualan aset perusahaan, konsolidasi atau restrukturisasi, pembiayaan atau akuisisi semua atau sebagian dari bisnis kami oleh atau ke perusahaan lain, untuk keperluan transaksi tersebut (bahkan jika kemudian transaksi tidak dilanjutkan);</li><li xss=\"removed\">sehubungan dengan proses klaim asuransi, kami akan membagikan Informasi Pribadi anda untuk tujuan pemrosesan klaim asuransi kepada perusahaan asuransi yang bekerja sama atau berkolaborasi dengan kami;</li><li xss=\"removed\">kepada pihak ketiga (termasuk agen, vendor, pemasok, kontraktor, mitra, dan pihak lain yang memberikan layanan kepada kami atau anda, melakukan tugas atas nama kami, atau pihak dengan siapa kami mengadakan kerja sama komersial), untuk atau sehubungan dengan tujuan di mana pihak ketiga tersebut terlibat, untuk melaksanakan pengungkapan kepada pihak ketiga terkait yang secara teknis diperlukan untuk memproses transaksi anda atau tujuan kerja sama kami dengan pihak ketiga tersebut (tergantung keadaannya), yang dapat mencakup diperbolehkannya pihak ketiga tersebut untuk memperkenalkan atau menawarkan produk atau layanan kepada anda, melakukan autentikasi terhadap anda atau menghubungkan anda dengan Akun atau melakukan kegiatan lain termasuk pemasaran, penelitian, analisis dan pengembangan produk; dan</li><li xss=\"removed\">dalam hal kami berbagi Informasi Pribadi dengan afiliasi, kami akan melakukannya dengan maksud agar mereka membantu kami dalam menyediakan Aplikasi, untuk mengoperasikan bisnis kami (termasuk, ketika anda berlangganan milis kami, untuk tujuan pemasaran langsung), atau untuk tujuan pengolahan data atas nama kami. Misalnya, sebuah afiliasi Gojek di negara lain dapat mengolah dan/atau menyimpan Informasi Pribadi anda atas nama perusahaan grup Gojek di negara anda. Semua afiliasi kami berkomitmen untuk mengolah Informasi Pribadi yang mereka terima dari kami sesuai dengan Kebijakan Privasi dan peraturan perundang-undangan yang berlaku ini.</li></ul></li><br><li xss=\"removed\">Ketika Informasi Pribadi tidak perlu dikaitkan dengan anda, kami akan melakukan upaya yang wajar untuk menghapus dikaitkannya Informasi Pribadi tersebut dengan anda sebagai individu sebelum mengungkapkan atau berbagi informasi tersebut.</li><br><li xss=\"removed\">Kami tidak akan menjual atau menyewakan Informasi Pribadi anda.</li><br><li xss=\"removed\">Selain sebagaimana diatur dalam Kebijakan Privasi ini, kami dapat mengungkapkan dan membagikan Informasi Pribadi anda jika kami memberitahu anda dan kami telah memperoleh persetujuan anda untuk pengungkapan atau pembagian tersebut.</li><br></ol></li><p xss=\"removed\"> </p><li xss=\"removed\"><strong>PENYIMPANAN INFORMASI PRIBADI</strong><ol xss=\"removed\"><li xss=\"removed\">Informasi Pribadi anda hanya akan disimpan selama diperlukan untuk memenuhi tujuan dari pengumpulannya, atau selama penyimpanan tersebut diperlukan atau diperbolehkan oleh peraturan perundang-undangan yang berlaku. Kami akan berhenti menyimpan Informasi Pribadi, atau menghapus maksud dari dikaitkannya Informasi Pribadi tersebut dengan anda sebagai individu, segera setelah dianggap bahwa tujuan pengumpulan Informasi Pribadi tersebut tidak lagi dibutuhkan dengan menyimpan Informasi Pribadi dan penyimpanan tidak lagi diperlukan untuk tujuan bisnis atau secara hukum.</li><br><li xss=\"removed\">Mohon diperhatikan bahwa masih ada kemungkinan bahwa beberapa Informasi Pribadi anda disimpan oleh pihak lain dengan termasuk institusi pemerintah cara tertentu. Dalam hal kami membagikan Informasi Pribadi anda kepada institusi pemerintah yang berwenang dan/atau institusi lainnya yang dapat ditunjuk oleh pemerintah yang berwenang atau memiliki kerja sama dengan kami, anda menyetujui dan mengakui bahwa penyimpanan Informasi Pribadi anda oleh institusi terkait akan mengikuti kebijakan penyimpanan data masing-masing institusi tersebut. Informasi yang disampaikan melalui komunikasi antara pengguna dan penyedia layanan yang dilakukan selain melalui penggunaan Aplikasi (seperti melalui panggilan telepon, SMS, pesan seluler atau cara komunikasi lainnya dan pengumpulan atas Informasi Pribadi anda oleh agen kami) juga dapat disimpan dengan beberapa cara. Kami tidak mengizinkan penyimpanan Informasi Pribadi dengan cara demikian dan kami tidak bertanggung jawab kepada anda untuk hal tersebut. Kami tidak akan bertanggung jawab atas penyimpanan Informasi Pribadi anda. Anda setuju untuk mengganti rugi, membela, dan membebaskan kami, pejabat, direktur, karyawan, agen, mitra, pemasok, kontraktor, dan afiliasi kami dari dan terhadap setiap dan segala klaim, kerugian, kewajiban, biaya, kerusakan, dan ongkos (termasuk tetapi tidak terbatas pada biaya hukum dan pengeluaran biaya ganti rugi penuh) yang dihasilkan secara langsung atau tidak langsung dari setiap penyimpanan yang tidak sah atas Informasi Pribadi anda.</li><br></ol></li><p xss=\"removed\"> </p><li xss=\"removed\"><strong>AKSES DAN KOREKSI INFORMASI PRIBADI</strong><ol xss=\"removed\"><li xss=\"removed\">Tunduk pada peraturan perundang-undangan yang berlaku, anda dapat meminta kepada kami untuk mengakses dan/atau mengoreksi Informasi Pribadi anda yang berada dalam kepemilikan dan penguasaan kami, dengan menghubungi kami di perincian yang disediakan di bawah ini.</li><br><li xss=\"removed\">Kami berhak menolak permintaan anda untuk mengakses, atau untuk memperbaiki, sebagian atau semua Informasi Pribadi anda yang kami miliki atau kuasai jika diizinkan atau diperlukan berdasarkan perundang-undangan yang berlaku. Hal ini termasuk dalam keadaan di mana Informasi Pribadi tersebut dapat berisi referensi kepada orang lain atau di mana permintaan untuk akses atau permintaan untuk mengoreksi adalah untuk alasan yang kami anggap tidak relevan, tidak serius, atau menyulitkan.</li><br></ol></li><p xss=\"removed\"> </p><li xss=\"removed\"><strong>TEMPAT KAMI MENYIMPAN INFORMASI PRIBADI ANDA</strong><ol xss=\"removed\"><li xss=\"removed\">Informasi Pribadi dari anda yang kami kumpulkan dapat disimpan, ditransfer, atau diolah oleh penyedia layanan pihak ketiga. Kami akan menggunakan semua upaya yang wajar untuk memastikan bahwa semua penyedia layanan pihak ketiga tersebut memberikan tingkat perlindungan yang sebanding dengan komitmen kami berdasarkan Kebijakan Privasi ini.</li><br><li xss=\"removed\">Informasi Pribadi anda juga dapat disimpan atau diproses di luar negara anda oleh pihak yang bekerja untuk kami di negara lain, atau oleh penyedia layanan pihak ketiga, vendor, pemasok, mitra, kontraktor, atau afiliasi kami. Dalam hal tersebut, kami akan memastikan bahwa Informasi Pribadi tersebut tetap menjadi subjek dari tingkat perlindungan yang sebanding dengan apa yang disyaratkan dalam hukum negara anda (dan, dalam hal apapun, sejalan dengan komitmen kami dalam Kebijakan Privasi ini).</li><br></ol></li><p xss=\"removed\"> </p><li xss=\"removed\"><strong>KEAMANAN INFORMASI PRIBADI ANDA</strong><p xss=\"removed\">Kerahasiaan Informasi Pribadi anda adalah hal yang terpenting bagi kami. Kami akan memberlakukan upaya terbaik untuk melindungi dan mengamankan data dan Informasi Pribadi anda dari akses, pengumpulan, penggunaan atau pengungkapan oleh orang-orang yang tidak berwenang dan dari pengolahan yang bertentangan dengan hukum, kehilangan yang tidak disengaja, pemusnahan dan kerusakan atau risiko serupa. Namun, pengiriman informasi melalui internet tidak sepenuhnya aman. Walau kami akan berusaha sebaik mungkin untuk melindungi Informasi Pribadi anda, anda mengakui bahwa kami tidak dapat menjamin keutuhan dan keakuratan Informasi Pribadi apa pun yang anda kirimkan melalui Internet, atau menjamin bahwa Informasi Pribadi tersebut tidak akan dicegat, diakses, diungkapkan, diubah atau dihancurkan oleh pihak ketiga yang tidak berwenang, karena faktor-faktor di luar kendali kami. Anda bertanggung jawab untuk menjaga kerahasiaan detail Akun anda, termasuk kata sandi anda dan One Time Password (OTP) dengan siapapun dan harus selalu menjaga dan bertanggung jawab atas keamanan perangkat yang anda gunakan.</p></li><p xss=\"removed\"> </p><li xss=\"removed\"><strong>PERUBAHAN ATAS KEBIJAKAN PRIVASI INI</strong><p xss=\"removed\">Kami dapat meninjau dan mengubah Kebijakan Privasi ini atas kebijakan kami sendiri dari waktu ke waktu, untuk memastikan bahwa Kebijakan Privasi ini konsisten dengan perkembangan kami di masa depan, dan/atau perubahan persyaratan hukum atau peraturan. Jika kami memutuskan untuk mengubah Kebijakan Privasi ini, kami akan memberitahu anda tentang perubahan tersebut melalui pemberitahuan umum yang dipublikasikan pada Aplikasi dan/atau situs web, atau sebaliknya ke alamat e-mail anda yang tercantum dalam Akun anda. Anda setuju bahwa anda bertanggung jawab untuk meninjau Kebijakan Privasi ini secara teratur untuk informasi terbaru tentang pengolahan data dan praktik perlindungan data kami, dan bahwa dengan anda terus menggunakan Aplikasi atau situs web kami, berkomunikasi dengan kami, atau mengakses dan menggunakan layanan setelah adanya perubahan apapun terhadap Kebijakan Privasi ini akan dianggap sebagai persetujuan anda terhadap Kebijakan Privasi ini dan segala perubahannya.</p></li><p xss=\"removed\"> </p><li xss=\"removed\"><strong>PENGAKUAN DAN PERSETUJUAN</strong><ol xss=\"removed\"><li xss=\"removed\">Dengan menyetujui Kebijakan Privasi, anda mengakui bahwa anda telah membaca dan memahami Kebijakan Privasi ini dan menyetujui segala ketentuannya. Secara khusus, anda setuju dan memberikan persetujuan kepada kami untuk mengumpulkan, menggunakan, membagikan, mengungkapkan, menyimpan, mentransfer, atau mengolah Informasi Pribadi anda sesuai dengan Kebijakan Privasi ini.</li><br><li xss=\"removed\">Dalam keadaan di mana anda memberikan kepada kami Informasi Pribadi yang berkaitan dengan individu lain (seperti Informasi Pribadi yang berkaitan dengan pasangan anda, anggota keluarga, teman, atau pihak lain), anda menyatakan dan menjamin bahwa anda telah memperoleh persetujuan dari individu tersebut untuk, dan dengan ini menyetujui atas nama individu tersebut untuk, pengumpulan, penggunaan, pengungkapan dan pengolahan Informasi Pribadi mereka oleh kami.</li><br><li xss=\"removed\">Anda dapat menarik persetujuan anda untuk setiap atau segala pengumpulan, penggunaan atau pengungkapan Informasi Pribadi anda kapan saja dengan memberikan kepada kami pemberitahuan yang wajar secara tertulis menggunakan rincian kontak yang disebutkan di bawah ini. Anda juga dapat menarik persetujuan pengiriman komunikasi dan informasi tertentu dari kami melalui fasilitas \"opt-out\" atau pilihan \"berhenti berlangganan\" yang tersedia dalam pesan kami kepada anda. Tergantung pada keadaan dan sifat persetujuan yang anda tarik, anda harus memahami dan mengakui bahwa setelah penarikan persetujuan tersebut, anda mungkin tidak lagi dapat menggunakan Aplikasi atau layanan. Penarikan persetujuan anda dapat mengakibatkan penghentian Akun anda atau hubungan kontraktual anda dengan kami, dengan semua hak dan kewajiban yang muncul sepenuhnya harus dipenuhi. Setelah menerima pemberitahuan untuk menarik persetujuan untuk pengumpulan, penggunaan atau pengungkapan Informasi Pribadi anda, kami akan menginformasikan anda tentang konsekuensi yang mungkin terjadi dari penarikan tersebut sehingga anda dapat memutuskan apakah anda tetap ingin menarik persetujuan.</li><br></ol></li><p xss=\"removed\"> </p><li xss=\"removed\"><strong>MATERI PEMASARAN DAN PROMOSI</strong><p xss=\"removed\">Kami dan mitra kami dapat mengirimkan anda pemasaran langsung, iklan, dan komunikasi promosi melalui aplikasi push-notification, pesan melalui Aplikasi, pos, panggilan telepon, layanan pesan singkat (SMS), dan email (“<strong>Materi Pemasaran</strong>”) jika anda telah setuju untuk berlangganan milis kami, dan/atau setuju untuk menerima materi pemasaran dan promosi dari kami. Anda dapat memilih untuk tidak menerima komunikasi pemasaran tersebut kapan saja dengan mengklik pilihan “berhenti berlangganan” yang ada dalam pesan yang bersangkutan, atau menghubungi kami melalui detail kontak yang tercantum di bawah ini. Mohon perhatikan bahwa jika anda memilih untuk keluar, kami masih dapat mengirimi anda pesan-pesan non-promosi, seperti tanda terima atau informasi tentang Akun anda.</p></li><p xss=\"removed\"> </p><li xss=\"removed\"><strong>DATA ANONIM</strong><p xss=\"removed\">Kami dapat membuat, menggunakan, melisensikan atau mengungkapkan Informasi Pribadi, yang tersedia, dengan catatan, (i) bahwa semua hal yang dapat mengidentifikasi telah dihapus sehingga data, baik sendiri atau dikombinasi dengan data lain yang tersedia, tidak dapat dihubungkan dengan atau dikaitkan dengan atau tidak dapat mengidentifikasi suatu individu, dan (ii) data serupa telah digabungkan sehingga data asli membentuk bagian dari kumpulan data yang lebih besar.</p></li><p xss=\"removed\"> </p><li xss=\"removed\"><strong>PLATFORM PIHAK KETIGA</strong><ol xss=\"removed\"><li xss=\"removed\">Aplikasi, situs web, dan Materi Pemasaran dapat berisi tautan ke situs web yang dioperasikan oleh pihak ketiga. Kami tidak mengendalikan atau menerima pertanggungjawaban atau tanggung jawab untuk situs web ini dan untuk pengumpulan, penggunaan, pemeliharaan, berbagi, atau pengungkapan data dan informasi oleh pihak ketiga tersebut. Silakan baca syarat dan ketentuan dan kebijakan privasi dari situs web pihak ketiga tersebut untuk mengetahui bagaimana mereka mengumpulkan dan menggunakan Informasi Pribadi anda.</li><br><li xss=\"removed\">Iklan yang terdapat pada Aplikasi, situs web, dan Materi Pemasaran kami berfungsi sebagai tautan ke situs web pengiklan dan dengan demikian segala informasi yang mereka kumpulkan berdasarkan klik anda pada tautan itu akan dikumpulkan dan digunakan oleh pengiklan yang relevan sesuai dengan kebijakan privasi pengiklan tersebut.</li><br></ol></li><p xss=\"removed\"> </p><li xss=\"removed\"><strong>CARA UNTUK MENGHUBUNGI KAMI</strong><p xss=\"removed\">Jika anda memiliki pertanyaan mengenai Kebijakan Privasi ini atau anda ingin mendapatkan akses dan/atau melakukan koreksi terhadap Informasi Pribadi anda, silahkan hubungi <a href=\"mailto:customerservice@go-jek.com\" xss=\"removed\">cs@quickray.</a><span xss=removed>tech</span></p><p xss=\"removed\">Untuk pertanyaan atau keluhan lainnya, anda dapat menghubungi kami melalui email atau telefon melalui kontak berikut: </p><p xss=\"removed\"><strong>Email</strong></p><ul><li xss=\"removed\"><strong>Untuk Layanan Konsumen:</strong> <a href=\"mailto:customerservice@go-jek.com\" xss=\"removed\">cs@quickray.</a>tech</li></ul><p xss=\"removed\"><br></p></li></ol></div>', '<div>Perusahaan yang bergerak dibidang Transportasi Online masa kini, yang merupakan aplikasi karya anak dalam negeri. </div><div>Visi dan misi mengutamakan manfaat dari adanya aplikasi ini untuk masyarakat sekitar,memajukan UMKM daerah dan membantu memajukan perekonomian daerah.</div><div>semoga dengan adanya aplikasi ini bisa bermanfaat untuk kita semua<br><br><br><br>Untuk info lebih lanjut tentang kami bisa hubungi kami di nomor</div><div>+6285624836317 - Hendy Hidayat (Majalengka) </div><div>+6281285414402 - Muhammad Nawawi(Cirebon) </div><div>+6282320410003 - Rara Jaunar Sy (Ciamis) </div><div>+6282387543071 - Khoir (Jambi)</div><div><br></div>', 'Reset Password', 'Registration accepted', '<div style=\"text-align: justify;\">Kami telah menerima permintaan Anda untuk mengatur ulang kata sandi. Harap konfirmasi melalui tombol di bawah ini:<br></div>', '<div style=\"text-align: justify;\">Abaikan email ini jika Anda tidak pernah meminta untuk mereset kata sandi Anda. Untuk pertanyaan, silakan hubungi</div>', '<div style=\"text-align: justify;\">Terima kasih telah mendaftar menjadi driver,dan kami telah menerima berkas anda, silakan klik tombol di bawah ini untuk mengatur ulang kata sandi Anda:<br></div>', '<div style=\"text-align: justify;\">Abaikan email ini jika Anda tidak pernah meminta untuk mereset kata sandi Anda. Untuk pertanyaan, silakan hubungi cs kami di<br>email : cs@quickray.tech</div>', 'lol.jpg', 'quickray.tech', '465', 'admin@quickray.tech', 'binarycode69', 'admin@quickray.tech', 'ssl', 'Quick', 'Email : cs@quickray.tech', 'https://play.google.com/store/apps/details?id=com.quickray.client', 'Rp', 'USD', 'Your Stripe Key', 'Your Stripe Published Key', '1', '0', 'AaD59-vRRBChEw4cikJJdP447xtdPdwRw5GdMCb_38CmvO0ZjgaqlQsP1Ok3FUKBHWolTzQGBPVbmUvT', '1', '0');
INSERT INTO `berita` (`id_berita`, `id_kategori`, `title`, `content`, `foto_berita`, `created_berita`, `status_berita`) VALUES
(9, '1', 'Cara Daftar MItra Quick', '<p>Berikut langkah-langkah cara daftar quick mitra</p><p>1. Download aplikasi quick partner di playstore atau klik link disini</p><p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href=\"https://play.google.com/store/apps/details?id=com.quickray.partner&amp;hl=en\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); font-weight: initial; font-size: 14.08px;\">https://play.google.com/store/apps/details?id=com.quickray.partner&amp;hl=en</a><br></p><p>2. Setelah download, buka aplikasi quick partner kemudian isi formulir yang sudah tersedia</p><p>3. Tunggu pesan dari admin untuk mengaktifkan akun</p><p><br></p>', '8ace4fd047edab1870ce6045e87bf6ca.jpg', '2020-08-17 00:18:47', '1'),
(10, '1', 'Bagaimana Aktivasi Driver?', '<p>CARA AKTIVASI DRIVER QUICK</p><p>- Download Aplikasi “QUICK Pengemudi ” di Playstore</p><p>- Klik “Daftar” pada tampilan awal aplikasi QUICK</p><p>- Isi data “formulir” yang tersedia di aplikasi&nbsp;</p><p>- Setelah selesai, “cek email” untuk aktivasi dan&nbsp;</p><p>&nbsp; &nbsp;membuat password&nbsp;</p><p><span style=\"font-size: 0.88rem; font-weight: initial;\">- Kemudian anda “login” dengan menggunakan</span></p><p>&nbsp; nomor dan pasword yang telah anda buat</p><p><span xss=\"removed\">Siapkan SIM dan KTP</span></p><p><span xss=\"removed\">Pastikan Nomor dan Emailmu Aktif</span></p><p><a href=\"https://play.google.com/store/apps/details?id=com.quickray.driver&amp;hl=en\" target=\"_blank\">https://play.google.com/store/apps/details?id=com.quickray.driver&amp;hl=en</a><span xss=\"removed\"><br></span><br></p>', '604e6b0b11ccb5e18731ff71c25773fd.jpg', '2020-08-27 04:19:37', '1');
